import "../styles/LandingPage.css";
const Header = () => {
  return <div className="Header">.Bakery</div>;
};

const LandingPage = () => {
  return (
    <div className="LandingPage">
      <Header />
      <div id="bakery-quote">Some catch and tasty quote</div>
      <div></div>
    </div>
  );
};

export default LandingPage;
